import Card from "./Components/UI/Card";
import IntroImage from "./Components/Layout/IntroImage";
import Header from "./Components/Layout/Header";
import About from './Components/Layout/About';

function App() {
  return (
    <>
      <Header />
      <IntroImage />
      <About />
      <Card>
        <h1>Contact</h1>
      </Card>
      <Card>
        <h1>Portfolio</h1>
      </Card>
      <Card>
        <h1>Experience</h1>
      </Card>
      <Card>
        <h1>Education</h1>
      </Card>
      <Card>
        <h1>Resume</h1>
      </Card>
    </>
  );
}

export default App;
